import React from "react";

export default function Checking() {
  let details = [
      [
        "Pankaj","Preet","Yaashi"
      ],
  ];

  return (
    <div>
      {details.map((x,i)=>{
        return <a key={i}>{x}</a>
      })}
    </div>
  );
}
